import React, { Component } from "react";
import { Collapse } from "reactstrap";
import photo from "../../../_assets/images/photo.jpg";
export default class Userblock extends Component {
  constructor(props) {
    super(props);
    this.toggle = this.toggle.bind(this);
    this.state = { collapse: false };
    this.toggle1 = this.toggle1.bind(this);
    this.state = { collapse1: false };
  }

  toggle() {
    this.setState(state => ({ collapse: !state.collapse }));
  }
  toggle1() {
    this.setState(state => ({ collapse1: !state.collapse1 }));
  }

  render() {
    return (
      <div className="usermenu">
        <ul>
          <li className="userarea">
            <img src={photo} alt="starlify" className="photo-icon" />{" "}
            <span className="name text-white">Name Surname</span>
          </li>
          <li>
            <span color="primary" onClick={this.toggle}>
              Toggle <i class="fas fa-chevron-down caret" />
            </span>
            <Collapse
              isOpen={this.state.collapse}
              style={{ marginLeft: "1rem", marginTop: "1rem" }}
            >
              Test
            </Collapse>
          </li>
          <li>
            <span color="primary" onClick={this.toggle1}>
              Toggle
            </span>
            <Collapse
              isOpen={this.state.collapse1}
              style={{ marginLeft: "1rem", marginTop: "1rem" }}
            >
              Test
            </Collapse>
          </li>
        </ul>
      </div>
    );
  }
}
